Movie Info: Boss is an Bollywood action masala film directed by Anthony D'Souza. The film will be produced by Cape of Good Films &amp; Ashwin Varde Productions and features Akshay Kumar, Mithun Chakraborty, Shiv Pandit, Aditi Rao Hydari and Ronit Roy in lead roles. It is apparently a remake of Malayalam film Pokkiri Raja starring Mammotty, Prithviraj and Shriya Saran.

The teaser of Boss was released on 14 August 2013, along with the Akshay Kumar starrer Once Upon Ay Time in Mumbai Dobaara! which released a day after. The theatrical trailer made its debut on YouTube on 27 August 2013, whilst the film released on 16 October 2013.

